%pyspark

from pyspark.sql import Row

def nan2int(n):
    try:
        i = int(n)
        return i;
    except ValueError:
        return 0

def pm2parquet(infilename, outfilename):
    uv = sc.textFile('hdfs://' + infilename)\
            .map(lambda s: s.split(','))\
            .map(lambda s: Row(datehour=s[0], pm10=nan2int(s[1]), pm25=nan2int(s[2])))\
            .toDF()
    uv.write.mode('overwrite').parquet('hdfs://' + outfilename)
